import React from "react";

import './form.css';

const Form = () => {

	return(
			<form onSubmit={this.props.loadWeather}>
				<input type="text" placeholder="Введите город"
						onChange={this.props.inputChange}
						value={this.props.value}
				/>
				<div><button>Получить погоду</button></div>
			</form>
		);
}

export default Form;
